import React from 'react';
import {Fragment} from 'react';

function About() {
    return (
        <Fragment>
            <div className="welcome-container">
                <h1> About </h1>
            </div>
            <div className="container">
                <h1>Our team</h1>
                
            </div>
        </Fragment>
    )
}
export default About;
